{"0": ["Пачка всяв скотче..,грязная,и это фирменный корм......пыльный согласна с ниже отзывом!", "2020-12-05T16:05:19Z", "", "0", 1, 0, 1, "Корм для канареек \" Breeders\", 1 кг", "Fiory"], "1": ["Купил несколько пачек, когда он стоил по 200 рублей.\r\nНо всё пришлось выбросить.\r\n\r\nКорм очень пыльный, на зёрнышках видно что-то похожее на плесень.\r\n\r\nПрилагаю фото, для сравнения с Рио и Versele Laga.\r\n\r\nНе понимаю как такое может появляться в продаже.", "2020-10-18T06:27:25Z", "", "0", 7, 0, 1, "Корм для канареек \" Breeders\", 1 кг", "Fiory"], "2": ["Решили просто выбросить. Деньги на ветер. Птицам побоялись давать. Не приятный запах, пыль прям и  какие-то примеси посторонние. С каким-то мусором смешали и положили в пакет и продают. Кошмар.", "2020-07-07T15:09:49.933953422Z", "colorless", "0", 7, 0, 1, "Корм для канареек \" Breeders\", 1 кг", "Fiory"]}
